import { Link } from 'react-router-dom'

const Navbar = () => {
  // We will eventually get 'user' from AuthContext here
  const user = null 

  return (
    <header>
      <div className="container">
        <Link to="/">
          <h1 style={{ color: 'var(--primary)' }}>Workout Recorder</h1>
        </Link>
        <nav>
          {user && (
            <div>
              <span>{user.email}</span>
              <button style={{marginLeft: '10px', background: 'none', border: '1px solid var(--primary)', color: 'var(--primary)', cursor: 'pointer', padding: '5px 10px', borderRadius: '4px'}}>Log out</button>
            </div>
          )}
          {!user && (
            <div>
              <Link to="/login" style={{ marginLeft: '20px' }}>Login</Link>
              <Link to="/signup" style={{ marginLeft: '20px' }}>Signup</Link>
            </div>
          )}
        </nav>
      </div>
    </header>
  )
}

export default Navbar
